import React from 'react';
import './RecentVideos.css';

function RecentVideos() {
    return (
        <div className='cards background'>
            <h1>Recent Videos</h1>
            <div className='cards__container'>
                <div className='cards__wrapper'>
                    <ul className='grid-layout'>

                    </ul>
                </div>
            </div>
        </div>
    )
}
